//Check if text has been changed via java/smali
void *antiLeech(void *) {
    //bad function

    sleep(5);

    if (!titleValid) {
        //Bad function to make it crash
        //Note: We want to avoid using exit() method call
        int *p = 0;
        *p = 0;
    }
    if (!headingValid) {
        int *p = 0;
        *p = 0;
    }
    if (!iconValid) {
        int *p = 0;
        *p = 0;
    }
    if (!featureListValid) {
        int *p = 0;
        *p = 0;
    }
    return NULL;
}

